<!DOCTYPE html>
<html>
  <head>
    <title>DOS_Menu</title>
    <meta http-equiv="X-UA-Compatible" content="IE=edge"/>
    <meta http-equiv="content-type" content="text/html; charset=utf-8"/>
    <link href="resources/css/axure_rp_page.css" type="text/css" rel="stylesheet"/>
    <link href="data/styles.css" type="text/css" rel="stylesheet"/>
    <link href="files/dos_menu/styles.css" type="text/css" rel="stylesheet"/>
    <script src="resources/scripts/jquery-3.2.1.min.js"></script>
    <script src="resources/scripts/axure/axQuery.js"></script>
    <script src="resources/scripts/axure/globals.js"></script>
    <script src="resources/scripts/axutils.js"></script>
    <script src="resources/scripts/axure/annotation.js"></script>
    <script src="resources/scripts/axure/axQuery.std.js"></script>
    <script src="resources/scripts/axure/doc.js"></script>
    <script src="resources/scripts/messagecenter.js"></script>
    <script src="resources/scripts/axure/events.js"></script>
    <script src="resources/scripts/axure/recording.js"></script>
    <script src="resources/scripts/axure/action.js"></script>
    <script src="resources/scripts/axure/expr.js"></script>
    <script src="resources/scripts/axure/geometry.js"></script>
    <script src="resources/scripts/axure/flyout.js"></script>
    <script src="resources/scripts/axure/model.js"></script>
    <script src="resources/scripts/axure/repeater.js"></script>
    <script src="resources/scripts/axure/sto.js"></script>
    <script src="resources/scripts/axure/utils.temp.js"></script>
    <script src="resources/scripts/axure/variables.js"></script>
    <script src="resources/scripts/axure/drag.js"></script>
    <script src="resources/scripts/axure/move.js"></script>
    <script src="resources/scripts/axure/visibility.js"></script>
    <script src="resources/scripts/axure/style.js"></script>
    <script src="resources/scripts/axure/adaptive.js"></script>
    <script src="resources/scripts/axure/tree.js"></script>
    <script src="resources/scripts/axure/init.temp.js"></script>
    <script src="resources/scripts/axure/legacy.js"></script>
    <script src="resources/scripts/axure/viewer.js"></script>
    <script src="resources/scripts/axure/math.js"></script>
    <script src="resources/scripts/axure/jquery.nicescroll.min.js"></script>
    <script src="data/document.js"></script>
    <script src="files/dos_menu/data.js"></script>
    <script type="text/javascript">
      $axure.utils.getTransparentGifPath = function() { return 'resources/images/transparent.gif'; };
      $axure.utils.getOtherPath = function() { return 'resources/Other.html'; };
      $axure.utils.getReloadPath = function() { return 'resources/reload.html'; };
    </script>
  </head>
  <body>
    <div id="base" class="">

      <!-- DOS_exit prompt (Dynamic Panel) -->
      <div id="u0" class="ax_default" data-label="DOS_exit prompt">
        <div id="u0_state0" class="panel_state" data-label="State1" style="">
          <div id="u0_state0_content" class="panel_state_content">

            <!-- DOS_Close_Prompt (Image) -->
            <div id="u1" class="ax_default image" data-label="DOS_Close_Prompt">
              <img id="u1_img" class="img " src="images/dos_menu/dos_close_prompt_u1.png"/>
              <div id="u1_text" class="text " style="display:none; visibility: hidden">
                <p></p>
              </div>
            </div>

            <!-- btn_yes (Rectangle) -->
            <div id="u2" class="ax_default box_1" data-label="btn_yes">
              <div id="u2_div" class=""></div>
              <div id="u2_text" class="text " style="display:none; visibility: hidden">
                <p></p>
              </div>
            </div>

            <!-- btn_no (Rectangle) -->
            <div id="u3" class="ax_default box_1" data-label="btn_no">
              <div id="u3_div" class=""></div>
              <div id="u3_text" class="text " style="display:none; visibility: hidden">
                <p></p>
              </div>
            </div>
          </div>
        </div>
      </div>

      <!-- DOS_Settings (Dynamic Panel) -->
      <div id="u4" class="ax_default" data-label="DOS_Settings">
        <div id="u4_state0" class="panel_state" data-label="State1" style="">
          <div id="u4_state0_content" class="panel_state_content">

            <!-- Unnamed (Image) -->
            <div id="u5" class="ax_default image">
              <img id="u5_img" class="img " src="images/dos_menu/u5.png"/>
              <div id="u5_text" class="text " style="display:none; visibility: hidden">
                <p></p>
              </div>
            </div>

            <!-- btn_back (Rectangle) -->
            <div id="u6" class="ax_default box_1" data-label="btn_back">
              <div id="u6_div" class=""></div>
              <div id="u6_text" class="text " style="display:none; visibility: hidden">
                <p></p>
              </div>
            </div>
          </div>
        </div>
      </div>

      <!-- DOS_MainMenu (Dynamic Panel) -->
      <div id="u7" class="ax_default" data-label="DOS_MainMenu">
        <div id="u7_state0" class="panel_state" data-label="State1" style="">
          <div id="u7_state0_content" class="panel_state_content">

            <!-- DOS_MainMenu (Image) -->
            <div id="u8" class="ax_default image" data-label="DOS_MainMenu">
              <img id="u8_img" class="img " src="images/dos_menu/dos_mainmenu_u8.png"/>
              <div id="u8_text" class="text " style="display:none; visibility: hidden">
                <p></p>
              </div>
            </div>

            <!-- btn_play (Rectangle) -->
            <div id="u9" class="ax_default box_1" data-label="btn_play">
              <div id="u9_div" class=""></div>
              <div id="u9_text" class="text " style="display:none; visibility: hidden">
                <p></p>
              </div>
            </div>

            <!-- btn_settings (Rectangle) -->
            <div id="u10" class="ax_default box_1" data-label="btn_settings">
              <div id="u10_div" class=""></div>
              <div id="u10_text" class="text " style="display:none; visibility: hidden">
                <p></p>
              </div>
            </div>

            <!-- btn_exit (Rectangle) -->
            <div id="u11" class="ax_default box_1" data-label="btn_exit">
              <div id="u11_div" class=""></div>
              <div id="u11_text" class="text " style="display:none; visibility: hidden">
                <p></p>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
    <script src="resources/scripts/axure/ios.js"></script>
  </body>
</html>
